import React from 'react';
import { Link } from 'react-router-dom';
import states from '../Data/state.json';


function StatesPage() {
  return (
    <div>
      <h1>Select a State</h1>
      <ul>
        {states.map(state => (
          <li key={state}>
            <Link to={`/dishes/${state}`}>{state}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default StatesPage;
